import React from 'react';
import { Link } from 'react-router-dom';  // Import Link to use for routing
import './MainPage.css';

function MainPage() {
  const isLoggedIn = !!localStorage.getItem('isLoggedIn');

  const handleLogout = () => {
    localStorage.removeItem('isLoggedIn');
    window.location.href = '/';
  };

  return (
    <div className="main-page">
      <header className="main-header">
        <nav className="main-nav">
          <ul>
            <li><Link to="/enter">Enter</Link></li>  // Changed from Main to Enter, directs to EnterPage
            <li><Link to="/map">Map</Link></li>
            <li><Link to="/profile">Profile</Link></li>
          </ul>
        </nav>
        <div className="login-section">
          {isLoggedIn ? (
            <button onClick={handleLogout}>Log out</button>
          ) : (
            <>
              <button><Link to="/login">Log in</Link></button>  // Changed to Link for consistency
              <button><Link to="/register">Register</Link></button>  // Changed to Link for consistency
            </>
          )}
        </div>
      </header>

      {/* Other contents of MainPage can remain as they were */}
    </div>
  );
}

export default MainPage;
